measurements.description:
Three flowers and two buds on one inflorescence plus one immature inflorescence;
	dorsal sepal white, proximally overlaid green, chocolate spots, proximal margins rolled, distal portion striated, flushed rose;
	synsepal light green, sparsley spotted, faintly spotted chocolate proximally;
	petals widely held, light green, spotted chocolate proximally, distally dark mauve;
	pouch light green lightly overlaid chestnut;
	staminode green;

	substance thin; texture waxy.
